import React from 'react'
import './historia.css';

const Historia = () => {
  return (
    <div className='website__historia section__padding' id="historia">
      <div className='website__historia-content'>
        <h1>Historia</h1>
        <h2>Memoria</h2>
        <p>Somos el Club de Salvamento y Socorrimo de Arganda del Rey. Estamos registrados en el Ayuntamiento de Arganda, en la Comunidad de Madrid y en las Federaciones Madrileña y Española de Salvamento.</p>
        <div className='website__historia-content-img'>

        </div>
      </div>
    </div>
  )
}

export default Historia
